import React, { useState } from "react";
import { Route } from "react-router-dom";

const App = () => {
    const [posts, setPosts] = useState([])
    const [token, setToken] = useState('')

    return <main>
        <Route exact path='/'><div>hello</div></Route>
        <Route exact id="/login"><div>login</div></Route>
        <Route exact id="/register"><div>register</div></Route>
        <Route exact id="/logout"><div>logout</div></Route>
        <Route exact id="/posts"><div>posts</div></Route>
    </main>
}

export default App
